(17, 4, 'Surgical Strickes in India is now become political issue.', '0000-00-00', 'davis parker', 'wrought-iron-gate-9826635.jpg', ' India is a country where politics plays now becomes in very bad condiation. Its like overburden of our country.India is a country where politics plays now becomes in very bad condiation. Its like overburden of our country.India is a country where politics plays now becomes in very bad condiation. Its like overburden of our country.India is a country where politics plays now becomes in very bad condiation. Its like overburden of our country.India is a country where politics plays now becomes in very bad condiation. Its like overburden of our country.India is a country where politics plays now becomes in very bad condiation. Its like overburden of our country.India is a country where politics plays now becomes in very bad condiation. Its like overburden of our country.India is a country where politics plays now becomes in very bad condiation. Its like overburden of our country.India is a country where politics plays now becomes in very bad condiation. Its like overburden of our country.'),
