(19, 5, 'India needs to be reformation', '0000-00-00', 'Sandeep manudhane', 'wrought-iron-gate-9826635.jpg', ' It''s the agricultural sector. Today with division of land amongst the families most farmers are marginal farmers and with increasing prices of fertilisers and other pests to protect the crops and it coupled with global warming effect of unpredictable rain patterns this sector in which most of our population is employed has made it an unprofitable sector. A farmer has to toil hard in the fields, take loan to bear the amount of all pests and fertilisers to protect the crop,  the cost of providing water to their crops as water from canals are not accessible to all the farmers , they have to confront the nature to reap what they have sown and lastly the market many a times doesn''t give good price to them if the particular commodity is in abundance. Even if the price of a commodity is good the farmers don''t get good price for it as the middleman takes all the profit. So, its the most stressed sector of our country which not only ensured s food security but development of the last men as India is primarily a nation of farmers. Not only our farms underproducing as compared to other nations the price of producing a ops are rising everyday and most of our population employed in this sector is facing innumerable problems everyday and finding it difficult to continue. So if you can do something about it , it will be the biggest socialist programme witnessed ever in the history of India, a sort of revolution. God bless you.'),
(20, 5, 'Swacch Bharat Abhiyaan should be a pledge we need to take.', '0000-00-00', 'Saiprasad manohar', 'golden-rules-to-follow-780x487.jpg', ' There are very few simple things that we need to do to clean India as a part of this mission.\r\n1. Don''t Litter, throw waste in dustbin only.\r\n2. Don''t encourage spitting, immediately condemn people if found doing so.\r\n3. Avoid usage of Plastic covers, plastic disposables. Carry a bag with you when you go for shopping, teach the people around you the same.\r\n4. Teach Children about Cleanliness and Sanitation.\r\n5. Plant trees around your house.\r\n6. Separate Dry waste and wet waste in your house, ease the work of municipality workers.\r\n7. If possible join any of the NGOs working in your area towards cleaning of India. If not atleast contribute to it in someway.\r\n8. Avoid personal transport whenever possible. Encourage Car Pooling if you can''t avoid. Much better you can use Public transportation.\r\n9. Pool money along with your area mates and install large sized dustbins in the places where littering is done on the road or open place.\r\nWell there is still more to it.\r\n\r\nSome of you might even be wondering, how cleaning will help apart from reducing diseases.'),
